import "./Texts.css";

const TextTitle = ({name= "name" , color = "color",  fontsize = "fontSize"}) => {

    const bStyle = {
        color: color,
        fontSize: fontsize,
    };
    return(
        <h1 className="title" style={bStyle}> ${name} </h1>
    )
}
export default TextTitle;
